import React from "react";

function InputField({ type, placeholder, iconClass }) {
  return (
    <div className="form-control mb-3 d-flex align-items-center">
      <i className={iconClass}></i>
      <input
        type={type}
        placeholder={placeholder}
        style={{
          border: "none",
          width: "100%",
          outline: "none",
          boxShadow: "none",
        }}
      />
      {type === 'password' && <i className="fa fa-eye ms-2 text-secondary"></i>}
    </div>
  );
}

export default InputField;
